import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import React from "react";
import Main from "./components/Main";
import Resume from "/components/Resume"

export default function App() {
  return (
    <Router>
      <Switch>
        <Route path="/resume">
          <Resume />
        </Route>
        <Route path="/">
          <Main />
        </Route>
      </Switch>
    </Router>
  );
}
